import Expensive from "./components/ExpenseItem";

function Expense(props){
    return <div>
          {
        props.expenses.map(item=>{
           return <Expensive id={item.id} title={item.title} amout={item.amount} date={item.date}></Expensive>;
        })
    }
    </div>
   
     
}


export default Expense;
